import React from "react";
import {Link} from "react-router-dom";

function Navbar(){
    let UserId = 5;
    return(
        <div>
            <ul>
                <li>
                    <Link to="/" >Home</Link>
                </li>
                <li>
                    <Link to={{pathname : '/User/getUser/' + UserId}}></Link>
                </li>
            </ul>
        </div>
    )
}

export default Navbar;
